import React,{Component} from 'react'
import generate from '../logic/ticket-generator'

class Generator extends Component{
    render(){
        var ticket= generate();
        return(
            <div>
                <p>Row1 {ticket[0].toStrin()}</p>
                <p>Row2 {ticket[1].toString()}</p>
                <p>Row3 {ticket[2].toString()}</p>
            </div>
        )
    }
}
export default Generator;
